import ExerciseList from "./components/ExerciseList"; // Componente para listar ejercicios

function App() {
  return (
    <div style={{ fontFamily: "Arial, sans-serif", textAlign: "center", padding: "20px" }}>
      <h1>Code Learning Platform</h1>
      <p>Choose a game to start learning!</p>
      <ExerciseList />
    </div>
  );
}

export default App;
